import React from "react";

const CourseList = ({ courses }) => {
  const sortedCourses = courses.sort((a, b) =>
    a.CRSTITLE.localeCompare(b.CRSTITLE)
  );

  const groupCoursesByLetter = () => {
    const groupedCourses = {};

    sortedCourses.forEach((course) => {
      const firstLetter = course.CRSTITLE.charAt(0).toUpperCase();

      if (groupedCourses[firstLetter]) {
        groupedCourses[firstLetter].push(course);
      } else {
        groupedCourses[firstLetter] = [course];
      }
    });

    return groupedCourses;
  };

  const groupedCourses = groupCoursesByLetter();

  return (
    <>
      {Object.entries(groupedCourses).map(([letter, courses]) => (
        <div key={letter}>
          <h2>{letter}</h2>
          <ul>
            {courses.map((course) => (
              <li key={course.CRSSUBJCD + course.CRSNBR}>{course.CRSTITLE}</li>
            ))}
          </ul>
        </div>
      ))}
    </>
  );
};

export default CourseList;
